import React from 'react'
import greenGradient from '../../../public/assets/gradients/green Gradient.png'

const Gradients = () => {
  return (
    <div className='absolute top-0 right-0'>
      <img src={greenGradient} alt="Green Gradient" />
    </div>
  )
}

export default Gradients
